value.original:
The result determines the title to be displayed for this Window, used also as the label for Recent Items.
Format is just one or several context variables surrounded by @, examples:
@TaxID@
@DocumentNo@
@Value@ @Name@
if this field is left empty a default title/label is created using the DocumentNo, Value and Name fields if they exist.

row.value:
Campo para definir a Fórmula da Base de Cálculo do Imposto;
Usar o nome dos impostos separados por @. Ex. @PIS@;
Usar @AMT@ quando for identificar o valor do Produto/Serviço

Campo para definir a Fórmula de Cálculo do Valor Líquido (usada quando o preço está com Impostos Inclusos);
Usar o nome dos impostos separados por @. Ex. @PIS@;
Usar @AMT@ quando for identificar o valor do Produto/Serviço

Indica a situação da NF. As opções possíveis são:
1=Uso Autorizado;
2=Uso Denegado;
